    '一个老同学来北京出差，约了另一个在北京久未联系的同学聚餐，席间还是不出意外的问到，怎么还没对象？…这么多年有北京户口吗？…北京买房了吗？…那在老家买房了吗？听说谁谁谁身价几千万，买了多少套房…回家一想，话不投机可能就是这样吧',
    '老家乡下有一大伯种了一片西瓜。昨晚硬是把偷西瓜的整服了！大伯在瓜地放了不少地钉。偷瓜人不小心踩到。看到田埂上有个草垛。就坐上去准备拔掉脚板上的钉子。谁知刚坐下。屁股又扎了两颗钉。一痛之下赶紧用手撑起。手撑在草垛两边。“嗦”一声痛苦抽搐。每个掌心一个钉子。。。',
