    '场景一：app开发团队经常要用手机测试各种场景手机的状态，所以会出现手机不堪重负司机的情况。产品拿着手机冲着安卓程序员大声喊：“你给我刷个机吧！” 程序员接话：“行，我一会给你刷个机吧！…” 是我太邪恶了？他们居然一个都没反应。 场景二：商务部推广app，叫技术给他打个推广用的安装包，为了省词，直接说：“你赶紧给我开个包！” 声音还很大，我憋着没笑出来。',
